#
# TABLE STRUCTURE FOR: Comments
#

DROP TABLE IF EXISTS `Comments`;

CREATE TABLE `Comments` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `User_ID` int(9) unsigned NOT NULL,
  `Review_ID` int(9) unsigned NOT NULL,
  `Text` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: File_Type
#

DROP TABLE IF EXISTS `File_Type`;

CREATE TABLE `File_Type` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Files
#

DROP TABLE IF EXISTS `Files`;

CREATE TABLE `Files` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `File_Type_ID` decimal(10,2) unsigned NOT NULL,
  `Film_ID` decimal(10,2) unsigned NOT NULL,
  `Link` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Films
#

DROP TABLE IF EXISTS `Films`;

CREATE TABLE `Films` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) NOT NULL,
  `Description` varchar(500) DEFAULT NULL,
  `Genre_ID` decimal(10,2) NOT NULL,
  `Poster_ID` decimal(10,2) NOT NULL,
  `Trailer_ID` decimal(10,2) NOT NULL,
  `Studio_ID` decimal(10,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Genre
#

DROP TABLE IF EXISTS `Genre`;

CREATE TABLE `Genre` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Rating
#

DROP TABLE IF EXISTS `Rating`;

CREATE TABLE `Rating` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `User_ID` decimal(10,2) unsigned NOT NULL,
  `Film_ID` int(9) unsigned NOT NULL,
  `Rating` decimal(10,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Recommendation
#

DROP TABLE IF EXISTS `Recommendation`;

CREATE TABLE `Recommendation` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Film_ID` decimal(10,2) unsigned NOT NULL,
  `Recommendet_Film_ID` decimal(10,2) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Review
#

DROP TABLE IF EXISTS `Review`;

CREATE TABLE `Review` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `User_ID` int(9) unsigned NOT NULL,
  `Film_ID` int(9) unsigned NOT NULL,
  `Text` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Studio
#

DROP TABLE IF EXISTS `Studio`;

CREATE TABLE `Studio` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) NOT NULL,
  `Poster_ID` decimal(10,2) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Users
#

DROP TABLE IF EXISTS `Users`;

CREATE TABLE `Users` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `FullName` varchar(100) NOT NULL,
  `Type` decimal(10,2) unsigned NOT NULL,
  `Status` bit(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Users_Types
#

DROP TABLE IF EXISTS `Users_Types`;

CREATE TABLE `Users_Types` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;




